// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract Owned {
    constructor() { owner = payable(msg.sender); }
    address payable owner;
}

// Herencia simple
// Los contratos derivados pueden acceder a todos los miembros no privados, 
// incluidas las funciones internas y variables de estado. 
contract Destructible is Owned {
    // La función puede ser sobreescrita
    function destroy() virtual public {
        if (msg.sender == owner) selfdestruct(owner);
    }
}

//Si un contrato no implementa todas las funciones, sólo puede usarse como interfaz.
abstract contract Config {
    function lookup(uint id) public virtual returns (address adr);
}

abstract contract NameReg {
    function register(bytes32 name) public virtual;
    function unregister() public virtual;
}

// Herencias multiple
contract Named is Owned, Destructible {
    constructor(bytes32 name) {
        Config config = Config(0xD5f9D8D94886E70b06E474c3fB14Fd43E2f23970);
        NameReg(config.lookup(1)).register(name);
    }

    function destroy() public virtual override{
        if (msg.sender == owner) {
            Config config = Config(0xD5f9D8D94886E70b06E474c3fB14Fd43E2f23970);
            NameReg(config.lookup(1)).unregister();
            Destructible.destroy();
        }
    }
}

// Si un constructor acepta un argumento, es necesario proporcionarlo en la cabecera
// (o de forma similar a como se hace con los modificadores, en el constructor
// del contrato derivado (ver más abajo)).
contract PriceFeed is Owned, Destructible, Named("GoldFeed") {
    function updateInfo(uint newInfo) public {
        if (msg.sender == owner) info = newInfo;
    }

    function destroy() public override(Destructible, Named) { Named.destroy(); }
    function get() public view returns(uint r) { return info; }

    uint info;
}
